text:
@MKRIZSA50 @FriendEden100 I lived on St Pete Beach. This breaks my heart. St PB is one of the ten most beautiful beaches in the world.
After the Exxon Oil Spill, reservations for tourists and weddings were cancelled and nearly bankrupted the area.
This is so much worse. I am so sorry Tampa Bay.

